import React from "react";
import { Typography, Avarar, Grid, Box } from "@material-ui/core";
import avatar from "../avatar.png";

const Header = () => {
  return (
    <Box>
      <Avatar src={avatar} alt="Russel Crowe" />
    </Box>
  );
};

export default Header;
